import React from "react";
import "../css/login.css";
import {Button, Col, Form, Input, Row} from "antd";
import {LockOutlined, UserOutlined} from "@ant-design/icons";
import {NavLink} from "react-router-dom";

class Findpwd extends React.Component {
    render() {
        return (
            <div className={"loginPage"}>
                <section className={"find-content"}>
                    <div style={{marginLeft: "20px"}}>
                        <h2 className={"login-title"}>创客装修后台管理系统</h2>
                        <Form ref={this.loginFormRef}>
                            <Row>
                                <Col span={24}>
                                    <Form.Item
                                        name={"username"}
                                        rules={[  // 规则
                                            {
                                                required: true,
                                                message: '用户名不能为空'
                                            }
                                        ]}
                                    >
                                        <Input
                                            style={{borderRadius: "24px"}}
                                            prefix={<UserOutlined style={{color: 'rgba(0,0,0,0.25)'}}/>}
                                            placeholder={"请输入用户名"}
                                            size={"large"}/>
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={24}>
                                    <Form.Item name="password"
                                               rules={[
                                                   {
                                                       required: true,
                                                       message: '密码不能为空'
                                                   }

                                               ]}>
                                        <Input.Password
                                            style={{borderRadius: "24px"}}
                                            prefix={<LockOutlined style={{color: "rgba(0,0,0,0.25)"}}/>}
                                            placeholder={"请输入密码"}
                                            size={"large"}/>
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row>
                                <Col span={24}>
                                    <Button type={"primary"} style={{width: "100%", borderRadius: "24px"}}
                                            size={"large"} onClick={this.login}>登录</Button>
                                </Col>
                            </Row>
                        </Form>
                    </div>
                </section>
            </div>
        )
    }
}

export default Findpwd;
